void resume(List list)async{
  
  IOSink data = new File('data.json').openWrite(mode: FileMode.append);

  data.writeln("{");
  data.writeln("\"capitulos\":[");

  for(var c in list){
    data.writeln("  {");
    data.writeln("    \"sid\": \"${c["sid"]}\",");
    data.writeln("    \"id\": \"${c["id"]}\",");
    data.writeln("    \"nombre\": \"${c["nombre"]}\"");
    data.writeln("  },");
  };

  data.writeln("],");
  data.writeln("}");

  await data.close();
}

void unique(List list){
    var uniques = new Map<dynamic, bool>();

    for (var s in list) {
  	  uniques[s] = true;
	  }
    print("Unique ${uniques.length}");
    print(list.length);
